import React from 'react';
import PetCard from './PetCard/PetCard.js';
import withAuthorization from '../../withAuthorization.js';


const Pet = () => {
	return (
		<div>
			<PetCard />
		</div>
	);
}

const authCondition = (authUser) => !!authUser;
export default withAuthorization(authCondition)(Pet);
